class LowcodeComponent extends Component {
  state = {
    data: [],
    loading: false,
    options: {
      counterParty: [], //对手方
      tradingAcctNo: [], //交易账户
      eralyWarning: [], //盯市状态
    }
  }

  constructor() {
    this.lib = window.parent._lib;
    this.defaultParams = {
      counterPartyIdList: null,
      tradingAcctNoList: [],
      earlyWarning: null,
    }
  }

  //查询
  handleSearch(params) {
    this.setState({ loading: true })
    this.lib.bizApi.post('/base-server/counterParty/exposure/search/today', params).then(res => {
      console.log('查询数据', res)
      this.setState({
        data: res.data.slice(0, 30),
        loading: false,
      })
    })
  }

  //初始化下拉项
  initOptions() {
    //对手方
    this.lib.bizApi.get('/base-server/account/counterParty/queryAcctList').then(res => {
      // console.log('options', res.data)
      this.state.options.counterParty = res.data.map(x => {
        return {
          label: x.counterPartyName,
          value: x.counterPartyId
        }
      })
      this.setState({ options: { ...this.state.options } })
    })

    //交易账户
    //TODO 需要根据对手方关联过滤
    this.lib.bizApi.get('/base-server/account/tradingAcct/tradingAcctlist').then(res => {
      // console.log('options', res.data)
      this.state.options.tradingAcctNo = res.data.map(x => {
        return {
          label: x.tradingAcctName,
          value: x.tradingAcctNo
        }
      })
      this.setState({ options: { ...this.state.options } })
    })

    //盯市状态
    this.lib.bizApi.get('/base-server/counterParty/exposure/getEarlyWarningList').then(res => {
      // console.log('options', res.data)
      this.state.options.eralyWarning = res.data.map(x => {
        return {
          label: x.text,
          value: x.enumName
        }
      })
      this.setState({ options: { ...this.state.options } })
    })
  }

  componentDidMount() {
    console.log('didMount');
    this.initOptions();
    this.handleSearch(this.defaultParams);
  }

  componentWillUnmount() {
    console.log('will unmount');
  }

  onSearch(value, errors, fileds) {
    const { counterPartyIdList, ...rest } = fileds.getValues() || {}
    const params = {
      ...this.defaultParams,
      counterPartyIdList: counterPartyIdList ? [counterPartyIdList] : null,
      ...rest,
    }
    this.handleSearch(params)
  }

  onReset() {
    this.handleSearch(this.defaultParams)
  }

  onDownCsv() {
    this.lib.downCsv({
      title: "实时资金风险",
      data: [
        { id: 1, text: 1 },
        { id: 2, text: 2 },
      ],
      options: [
        { title: '唯一标识符', dataIndex: "id" },
        { title: '显示文本', dataIndex: "text" },
      ]
    })
  }

}
